import Link from "next/link";
const About = () => {
  return (
    <div>
      <ul>
        <li>
          <Link href="/">
            <button>Home</button>
          </Link>
        </li>
        <li>
          <Link href="/about">
            <button>About</button>
          </Link>
        </li>
      </ul>
      <h2>About Page</h2>
    </div>
  );
};
export default About;
